import React from 'react'
import Clock from './Clock'

function Welcome(props) {
  return <h1>Hello, {props.name}</h1>;
}

const element = <Welcome name="Sara" />;

export default function App() {
    return (
		<div>
		<Clock />
        element
		</div>
    )
}
